      const pixel = Math.floor(Math.min(size[0], size[1]) / 4);

      const delta = (pixel * MERC_MAX) / 128 / Math.pow(2, mercZoom);
      const crossDelta = this.rotateMatrix(MERC_CROSSMATRIX, direction);
      return crossDelta.map(xy => [
        xy[0] * delta + center[0],
        xy[1] * delta + center[1]
      ]);
